import React, { useEffect, useState } from 'react';

const ImageSection = () => {
  const [latestImage, setLatestImage] = useState(null);
  const [analyzedImage, setAnalyzedImage] = useState(null);
  const [latestAudio, setLatestAudio] = useState(null);
  const [analyzedAudio, setAnalyzedAudio] = useState(null);
  const [predictionText, setPredictionText] = useState("");

  useEffect(() => {
    const fetchPrediction = async (filename) => {
      const txtName = filename.replace(".jpg", ".txt");
      try {
        const res = await fetch(`http://220.149.235.221:4000/save_bird_class/${txtName}`);
        const text = await res.text();
        setPredictionText(text.trim());
      } catch (err) {
        console.error("❌ 예측 결과 불러오기 실패:", err);
        setPredictionText("");
      }
    };

    const fetchAssets = async () => {
      // 1. 원본 이미지
      try {
        const res = await fetch('http://220.149.235.221:4000/api/images');
        const fileList = await res.json();
        const sorted = fileList
          .filter(name => name.startsWith('frame_') && name.endsWith('.jpg'))
          .sort((a, b) => {
            const getTime = f => {
              const match = f.match(/frame_(\d+)\.jpg/);
              return match ? parseInt(match[1]) : 0;
            };
            return getTime(b) - getTime(a);
          });

        if (sorted.length > 0) {
          setLatestImage(`http://220.149.235.221:4000/images/${sorted[0]}`);
          await fetchPrediction(sorted[0]);
        } else {
          setLatestImage(null);
          setPredictionText("");
        }
      } catch (err) {
        console.error("❌ 이미지 불러오기 실패:", err);
        setLatestImage(null);
        setPredictionText("");
      }

      // 2. 분석 이미지
      try {
        const res = await fetch('http://220.149.235.221:4000/api/images_result');
        const fileList = await res.json();
        const sorted = fileList
          .filter(name => name.startsWith('frame_result_') && name.endsWith('.jpg'))
          .sort((a, b) => {
            const getTime = f => {
              const match = f.match(/frame_result_(\d+)\.jpg/);
              return match ? parseInt(match[1]) : 0;
            };
            return getTime(b) - getTime(a);
          });
        setAnalyzedImage(sorted[0] ? `http://220.149.235.221:4000/images_result/${sorted[0]}` : null);
      } catch (err) {
        console.error("❌ 분석 이미지 불러오기 실패:", err);
        setAnalyzedImage(null);
      }

      // 3. 오디오
      try {
        const res = await fetch('http://220.149.235.221:4000/api/sounds');
        const fileList = await res.json();
        const audioFiles = fileList.filter(name => name.endsWith('.wav') || name.endsWith('.mp3'));
        const original = audioFiles
          .filter(name => !name.includes('_result'))
          .sort((a, b) => {
            const getTime = f => parseInt(f.match(/(\d+)/)?.[1] || 0);
            return getTime(b) - getTime(a);
          });

        const latest = original[0];
        const result = latest?.replace(/\.(wav|mp3)$/, '_result.$1');

        setLatestAudio(latest ? `http://220.149.235.221:4000/sounds/${latest}` : null);
        setAnalyzedAudio(result ? `http://220.149.235.221:4000/sounds/${result}` : null);
      } catch (err) {
        console.error("❌ 오디오 불러오기 실패:", err);
        setLatestAudio(null);
        setAnalyzedAudio(null);
      }
    };

    fetchAssets();
    const interval = setInterval(fetchAssets, 5000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="p-8 grid grid-rows-2 gap-12">
      <div className="grid grid-cols-2 gap-6">
        {/* 원본 이미지 */}
        <div>
          <div className="text-center font-bold text-lg mb-3">최근에 찍힌 사진</div>
          <div className="border border-black h-72 flex flex-col items-center justify-center">
            {latestImage ? (
              <>
                <img src={latestImage} alt="최근 이미지" className="max-h-full object-contain" />
                <div className="mt-2 text-sm text-center text-blue-600 font-semibold">{predictionText || "예측 없음"}</div>
              </>
            ) : (
              <span className="text-gray-500">이미지를 불러오는 중...</span>
            )}
          </div>
        </div>

        {/* 분석 이미지 */}
        <div>
          <div className="text-center font-bold text-lg mb-3">AI가 분석한 사진</div>
          <div className="border border-black h-72 flex items-center justify-center">
            {analyzedImage ? (
              <img src={analyzedImage} alt="AI 분석 이미지" className="max-h-full object-contain" />
            ) : (
              <span className="text-gray-500">분석 이미지를 불러오는 중...</span>
            )}
          </div>
        </div>
      </div>

      <div className="grid grid-cols-2 gap-6">
        {/* 원본 오디오 */}
        <div>
          <div className="text-center font-bold text-lg mb-3">최근에 녹음된 음성</div>
          <div className="border border-black h-36 flex items-center justify-center">
            {latestAudio ? (
              <audio controls>
                <source src={latestAudio} />
                브라우저가 오디오 태그를 지원하지 않습니다.
              </audio>
            ) : (
              <span className="text-gray-500">오디오를 불러오는 중...</span>
            )}
          </div>
        </div>

        {/* 분석 오디오 */}
        <div>
          <div className="text-center font-bold text-lg mb-3">AI가 분석한 음성</div>
          <div className="border border-black h-36 flex items-center justify-center">
            {analyzedAudio ? (
              <audio controls>
                <source src={analyzedAudio} />
                브라우저가 오디오 태그를 지원하지 않습니다.
              </audio>
            ) : (
              <span className="text-gray-500">분석 오디오를 불러오는 중...</span>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ImageSection;
